              40} v -60 v 70 C ${this.state.lastNameBaseX + 360} ${this.state
              .lastNameBaseY - 40},${this.state.lastNameBaseX + 360} ${
              this.state.lastNameBaseY
            } , ${this.state.lastNameBaseX + 400} ${
              this.state.lastNameBaseY
            } C ${this.state.lastNameBaseX + 400} ${
